import React from 'react';
import'./Footer.css'

export default function Footer() {
  return (
      <div className='home-footer-container'>
          <div className='home-footer-parent'>
              <img src={require('../../../assets/Home/shape-bg.png')} alt='no internet connection'/>
          </div>
      </div>
  )
}
